                    <span className="text-orange">dream company</span>{" "}
                </h1>
            </div>
        </div>

    </section>
    <div className={`${styles.flexCenter} content-center items-center py-5`}>
        <Cardintern />
    </div>

    </>
  )
}

export default Listperusahaan
